import React from 'react';
import axios from 'axios';

function App() {
  const data = axios.get('http://localhost:8081')
      .then((res) => {
          console.log(res);
      }).catch((err) => {
          console.error(err);
      })
  return (
    <div className="App">
      <button onClick={data}>서버 정보 출력</button>
    </div>
  );
}

export default App;
